import React, { useRef, useState } from 'react';
import emailjs from 'emailjs-com';
import { Mail, Phone, MapPin, Send } from 'lucide-react';

const SERVICE_ID = 'your_service_id'; // Replace with your EmailJS Service ID
const TEMPLATE_ID = 'your_template_id'; // Replace with your EmailJS Template ID
const USER_ID = 'your_public_key'; // Replace with your EmailJS Public Key

const Contact = () => {
  const form = useRef();
  const [sent, setSent] = useState(false);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const sendEmail = (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    emailjs.sendForm(SERVICE_ID, TEMPLATE_ID, form.current, USER_ID)
      .then((result) => {
        setSent(true);
        setLoading(false);
      }, (error) => {
        setError('Failed to send message. Please try again.');
        setLoading(false);
      });
  };

  return (
    <div className="min-h-screen bg-white pt-16">
      {/* Hero */}
      <section className="py-20 gradient-bg text-white">
        <div className="max-w-4xl mx-auto px-4 text-center" data-aos="fade-up">
          <h1 className="text-4xl md:text-5xl font-bold font-heading mb-6">Contact Us</h1>
          <p className="text-xl max-w-2xl mx-auto mb-6">
            Have questions or want to get in touch? Fill out the form below and our team will respond soon.
          </p>
        </div>
      </section>

      {/* Contact Form & Info */}
      <section className="py-16 bg-gray-50">
        <div className="max-w-5xl mx-auto px-4 grid md:grid-cols-2 gap-12 items-center">
          {/* Form */}
          <div data-aos="fade-up">
            <form ref={form} onSubmit={sendEmail} className="bg-white p-8 rounded-xl shadow-lg space-y-6">
              <div>
                <label className="block mb-2 font-medium text-gray-700">Name</label>
                <input type="text" name="user_name" required className="w-full px-4 py-3 border rounded-lg focus:outline-none focus:ring-2 focus:ring-primary-600" />
              </div>
              <div>
                <label className="block mb-2 font-medium text-gray-700">Email</label>
                <input type="email" name="user_email" required className="w-full px-4 py-3 border rounded-lg focus:outline-none focus:ring-2 focus:ring-primary-600" />
              </div>
              <div>
                <label className="block mb-2 font-medium text-gray-700">Subject</label>
                <input type="text" name="subject" required className="w-full px-4 py-3 border rounded-lg focus:outline-none focus:ring-2 focus:ring-primary-600" />
              </div>
              <div>
                <label className="block mb-2 font-medium text-gray-700">Message</label>
                <textarea name="message" rows="4" required className="w-full px-4 py-3 border rounded-lg focus:outline-none focus:ring-2 focus:ring-primary-600"></textarea>
              </div>
              <button type="submit" className="btn-primary w-full flex items-center justify-center" disabled={loading}>
                <Send className="mr-2 h-5 w-5" />
                {loading ? 'Sending...' : 'Send Message'}
              </button>
              {sent && <p className="text-green-600 font-medium">Message sent successfully!</p>}
              {error && <p className="text-red-600 font-medium">{error}</p>}
            </form>
          </div>

          {/* Contact Info & Illustration */}
          <div data-aos="fade-up" data-aos-delay="200" className="space-y-8">
            <div className="bg-primary-50 rounded-xl p-6 shadow flex flex-col items-start">
              <div className="flex items-center mb-2">
                <Mail className="h-5 w-5 text-primary-600 mr-2" />
                <span className="font-medium text-gray-700">info@edtech.com</span>
              </div>
              <div className="flex items-center mb-2">
                <Phone className="h-5 w-5 text-primary-600 mr-2" />
                <span className="font-medium text-gray-700">+1 (555) 123-4567</span>
              </div>
              <div className="flex items-center">
                <MapPin className="h-5 w-5 text-primary-600 mr-2" />
                <span className="font-medium text-gray-700">123 Education St, Tech City, TC 12345</span>
              </div>
            </div>
            <img src="https://undraw.co/api/illustrations/undraw_mail_sent_re_0ofv.svg" alt="Contact Illustration" className="w-full rounded-xl shadow" />
          </div>
        </div>
      </section>
    </div>
  );
};

export default Contact;
